// App.js or Routes.js

import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import HomePage from './homepage.js';
import DashboardPage from './Dashboard.js';
import GradeReportPage from './GradeReportPage.js';
import MissingGradeFormPage from './MissingGradeFormPage.js';
import InstructorContactPage from './InstructorContactPage.js';
import LoginPage from './LoginPage.js';

const App = () => {
  return (
    <Router>
      <Route path="/" exact component={HomePage} />
      <Route path="/dashboard" component={Dashboard.js} />
      <Route path="/grades" component={GradeReportingPage} />
      <Route path="/missing-grades" component={MissingGradesPage} />
      <Route path="/instructor-contact" component={InstructorContactPage} />
      <Route path="/help" component={HelpPage} />
    </Router>
  );
};

export default App;
